  password,
  setAuth,
  setNameError, setServerError) {

  axios({
    method: 'POST',
    baseURL: API + 'signin',
    data: {
      name: name,
      password: password
    }
  }).then((data) => {
    if (data.status === 203) {
      setNameError(true);
      return;
    } else {
      setAuth(data.headers.authorization);
      return;
    }
  }).catch((err) => {
    setServerError(true);
    return;
